import React,{useEffect} from "react";

import Navbar from "../Navbar.js";
import Footer from "../Footer.js";

import header from "../../assets/img/logitech/header.svg";

import "../../assets/css/style.css";



function Logitech () {

    useEffect(() => {
        // üëáÔ∏è scroll to top on page load
        window.scrollTo({top: 0, left: 0, behavior: 'smooth'});
      }, []);

    return (
    <>

    <div class = "mt-5"></div>

        <div class ="fixed-top">
            <Navbar/>
        </div>


        <img src = {header}  class = "mt-5" data-aos="fade-up" style = {{width:"110%"}}></img>

            <section class="section">
            <div class="container">

                <div data-aos="fade-up" class = "align-items-center">
                    <h2 class = "logitech-title">Overview</h2>
                    <p class = "col-md-7 mb-5" >I worked end-to-end on a machine learning model with over 95% accuracy 
                        to improve image validation for Uber Eats. This model has a cost saving
                         of $5 million anually.</p>
                </div>
            </div>



            </section>

        <Footer></Footer>    

    </>
    );
}

export default Logitech;
